package com.pradeep.pj.model;

public class MailProceesBean {
	
	String keyphrase;
	String project_nm;
	String client_nm;
	String user_nm;
	int id;
	
	
	public MailProceesBean() {
		super();
		// TODO Auto-generated constructor stub
	}


	public String getKeyphrase() {
		return keyphrase;
	}


	public void setKeyphrase(String keyphrase) {
		this.keyphrase = keyphrase;
	}


	public String getProject_nm() {
		return project_nm;
	}


	public void setProject_nm(String project_nm) {
		this.project_nm = project_nm;
	}


	public String getClient_nm() {
		return client_nm;
	}


	public void setClient_nm(String client_nm) {
		this.client_nm = client_nm;
	}


	public String getUser_nm() {
		return user_nm;
	}


	public void setUser_nm(String user_nm) {
		this.user_nm = user_nm;
	}


	public int getId() {
		return id;
	}


	public void setId(int id) {
		this.id = id;
	}
	
	
	
	
	

}
